import './App.css';
import {Box, Button} from "@mui/material";
import tubeImage from "./static/Tube.png"

function App() {

    const handleButton = () => {
        console.log("버튼 클릭됌.")
    }

  return (
    <div className="App">
      <header className="App-header">
          <Box width={"90%"} height={"auto"} flex={"display"} bgcolor={"yellow"} >
        <img src={tubeImage} alt={"튜브 따봉 이미지"} />
          </Box>
          <Button variant={"contained"} onClick={handleButton}>
              버튼~
          </Button>
      </header>
    </div>
  );
}

export default App;
